                <SmallHeading>Primary Actions</SmallHeading>
                <div className="dasshed-line" />
                <Select />
                <div className="flex">
                    <Select />
                    <Select />
                    <Select
                        closeMenuOnSelect={false}
                        isMulti={false}
                        options={NotificationSoundOPtions}
                        theme={theme => ({
                            ...theme,
                            borderRadius: 0,
                            colors: {
                                ...theme.colors,
                                text: '#f1f1f1',
                                primary25: '#74d69e',
                                primary: '#74d69e',
                            },
                        })}
                        placeholder="Select type"
                    />
                </div>
            </>
        )
    }
}

export default TriggerCampaign
